        } else {
          date = `${months} ${t("months")} ${days} ${t("days")}`;
        }
      }
    } else {
      if (years == 1) {
        date = `${years} ${t("year")}`;
      } else {
        date = `${years} ${t("years")}`;
      }
    }

    return date;
  }

