    function calcular(fecha) {
        var today = new Date();
        var yyyy = today.getFullYear();
        var today2 = new Date(fecha);
        var yyyy2 = today2.getFullYear();
        return (parseInt(yyyy) - parseInt(yyyy2));
    }
    function formatDate(date) {
        return moment(date).format("DD/MM/YYYY");
    }
    async function loadDebtsT24(debtor, transactionId) {
        var data = await api.consultBankingRelationsDebtsCP(transactionId);
        var element = data.getBankingRelationCPDTOList.find((element) => {
            return element.status === true;
        })
        if (element !== undefined && element !== null) {
            return;
        }

        data = await api.consultBankRelationsDebtsLP(transactionId);
        var element = data.bankingRelationLPDTOList.find((element) => {
            return element.status === true;
        })
        if (element !== undefined && element !== null) {
            return;
        }

        var result = await apiCore.getAllTermDebts(debtor.customerNumberT24, debtor.clientDocId, debtor.idType).then(result => {
            if (result !== null && result !== undefined) {
                //console.log("loadDebtsT24 short", result.shortTermresult);

                for (var short of result.shortTermresult) {
                    var dat = {
                        "facilityType": short.facilityType,
                        "amount": Number(short.approvedAmount).toFixed(2),
                        "date": short.startDate,
                        "expirationDate": short.endDate,
                        "debitBalance1": Number(short.balance).toFixed(2),
                        "debitBalance2": 0,
                        "debitBalance3": 0,
                        "rate": 0,
                        "fee": 0,
                        "bail": 0,
                        "fundDestiny": "",
                        "bank": short.bank,
                        "transactId": Number(transactionId)
                    }
                    api.newBankingRelationsDebtsCP(dat);
                }

                for (var long of result.longTermresult) {
                    var dat1 = {
                        "transactId": Number(transactionId),
                        "bank": long.bank,
                        "facilityType": long.facilityType,
                        "amount": Number(long.approvedAmount.toFixed(2)),
                        "date": long.startDate,
                        "expirationDate": long.endDate,
                        "debitBalance1": Number(long.balance.toFixed(2)),
                        "debitBalance2": 0,
                        "debitBalance3": 0,
                        "rate": 0,
                        "fee": 0,
                        "bail": " ",
                        "fundDestiny": " "
                    }
                    api.newBankingRelationsDebtsLP(dat1);
                }

                setloadDebtsAuto(!loadDebtsAuto);
            }
        }).catch(err => { });
    }
